import React from "react";
import "./Background.css";

const Background = () => {
  return (
    <React.Fragment>
      <section className="wrapper">
        <div id="stars1"></div>
        <div id="stars2"></div>
        <div id="stars3"></div>
        <div id="stars4"></div>
      </section>
    </React.Fragment>
  );
};
export default Background;
